import { useState } from 'react'

function Groups(){
    const [groups, setGroups] = useState([])

    fetch('/groups').then(res => res.json()).then(data => setGroups(data))

    const renderGroups = groups.map((group) => {
        return (
            console.log(group)
        )
    })

    return (
        // <h1>Groups</h1>
        renderGroups
    )
}

export default Groups
